def getConfigs( tCfgFile ):
	print ('getConfigs: tCfgFile=', tCfgFile)
	# 判断文件是否存在
	if not os.path.exists(tCfgFile):
		return
	#end if
    
	with open(tCfgFile,'r') as f:
		data = json.load(f)
	#end with
	return data
